import React from 'react';
import './Expertise.css';

const Expertise = () => {
  const expertiseAreas = [
    {
      title: "AI Ethics Auditing",
      description: "Comprehensive evaluation of AI systems for bias, fairness, and ethical compliance.",
      icon: "üîç"
    },
    {
      title: "Policy Development",
      description: "Creating ethical guidelines and policies for AI implementation across organizations.",
      icon: "üìã"
    },
    {
      title: "Stakeholder Education",
      description: "Training teams and leadership on ethical AI principles and best practices.",
      icon: "üéì"
    },
    {
      title: "Risk Assessment",
      description: "Identifying and mitigating ethical risks in AI development and deployment.",
      icon: "‚ö†Ô∏è"
    },
    {
      title: "Compliance Consulting",
      description: "Ensuring AI systems meet regulatory requirements and ethical standards.",
      icon: "‚úÖ"
    },
    {
      title: "Public Speaking",
      description: "Sharing insights on AI ethics at conferences and industry events.",
      icon: "üé§"
    }
  ];

  return (
    <section id="expertise" className="expertise">
      <div className="container">
        <div className="expertise-header">
          <h2 className="section-title">My Expertise</h2>
          <p className="section-subtitle">
            Specialized knowledge in AI ethics and responsible technology development
          </p>
        </div>
        <div className="expertise-grid">
          {expertiseAreas.map((area, index) => (
            <div key={index} className="expertise-card">
              <div className="expertise-icon">{area.icon}</div>
              <h3 className="expertise-title">{area.title}</h3>
              <p className="expertise-description">{area.description}</p>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Expertise;
